import { combineReducers } from 'redux';
import playersReducers from './player/playersReducers';
import reportReducers from './report/reportReducers';
import reportTypeReducers from './reportType/reportTypeReducers';
import commentReducers from './comment/commentReducers';

const rootReducer = combineReducers({
    players: playersReducers,
    reportType: reportTypeReducers,
    reports:  reportReducers,
    comments: commentReducers
})
 
export default rootReducer
